    "sea-turtle-gear-interaction-collected-in-the-gulf-of-mexico-caribbean-and-atlantic-from-1989-01",nt"isopen":
    false,nt"url": null,nt"notes": "The Southeast Fisheries Science Center
    Mississippi Laboratories is responsible for new gear development and testing to
    reduce bycatch and incidental interactions of protected species. A gear repository
    and associated fishing gear database are maintained and updated quarterly to track
    all reported human interactions with sea turtles strandings. Fishing gear and other
    articles from human interactions are collected by the Southeast Sea Turtle Stranding
    and Salvage Network (STSSN) and shipped to the gear repository for analysis and
    archiving. The gear is reviewed by staff gear experts that have a background in
    the particular fishery or commercial/recreational application.",nt"license_title":
